import React from 'react';
import { useRoutes } from 'react-router-dom';
import PokemonDetails from './pages/Home/components/PokemonDetails';
import Router from './routes/Router';

function App() {
  const routing = useRoutes(Router);

  return (
    <React.Fragment>
        <PokemonDetails />
      {routing}
    </React.Fragment>
  );
}

export default App;
